import React from "react";
import "./App.css";
import Login from "./compon/Login";
import Posts from "./compon/Posts";
import { BrowserRouter, Route,Switch,Link } from "react-router-dom";

function App() {
  return (
 
      <BrowserRouter>

      <div>
        <ul>
          <li>
            <Link to="/">Login</Link>
          </li>
          <li>
            <Link to="/about">Posts</Link>
          </li>
        </ul>

        <hr />

     
      
          <Route exact path="/">
            <Login />
          </Route>
          <Route path="/posts">
            <Posts />
          </Route>
      
      </div>
    

      </BrowserRouter>

  );
}
export default App;
